import React from "react";
import { connect } from "react-redux";

import { selectProductDeteails } from "../../redux/products/product.selectors";

import Header from "../../components/header/header.component";
import ProductDetailsPage from "../../components/product-details/product-details.component";

import "./details.page.styles.css";

const ProductDetailsPreview = ({ collection, history }) => {
  return (
    <div>
      <Header />
      <ProductDetailsPage collection={collection} history={history} />
    </div>
  );
};

const mapStateToProps = (state, ownProps) => {
  return {
    collection: selectProductDeteails(ownProps.match.url)(state),
  };
};

export default connect(mapStateToProps)(ProductDetailsPreview);
